import React from 'react';

// material-ui
import { CardContent, FormControlLabel, Grid, MenuItem, TextField, Radio, RadioGroup} from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from 'ui-component/cards/SubCard';

const ClientSelect = () => {
    const [city, setCity] = React.useState('1');
    const handleChangeCity = (event) => {
        setCity(event.target.value);
    };

    const [Country, setCountry] = React.useState('1');
    const handleSelectChange1 = (event) => {
        setCountry(event.target.value);
    };

    const [state1, setState1] = React.useState({
        checkedA: true
    });
    const handleChangeState1 = (event) => {
        setState1({ ...state1, [event.target.name]: event.target.checked });
    };
    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={12} sm={12} lg={6} md={6}>
                <TextField type='text' fullWidth label='Client' defaultValue='' />
            </Grid>

            <Grid item xs={12} md={6}>
                <SubCard title="Radio with Label">
                    <Grid container spacing={2}>
                        <Grid item>
                            <FormControl>
                                <RadioGroup
                                    row
                                    aria-label="gender"
                                    value={valueLabel}
                                    onChange={(e) => setValueLabel(e.target.value)}
                                    name="row-radio-buttons-group"
                                >
                                    <FormControlLabel value="checked" control={<Radio />} label="Checked" />
                                    <FormControlLabel value="unchecked" control={<Radio />} label="Unchecked" />
                                </RadioGroup>
                            </FormControl>
                        </Grid>
                        <Grid item>
                            <RadioGroup row aria-label="gender1" name="row-radio-buttons-group-disabled">
                                <FormControlLabel value="female1" control={<Radio />} label="Checked" checked disabled />
                                <FormControlLabel value="male1" control={<Radio />} label="Unchecked" disabled />
                            </RadioGroup>
                        </Grid>
                    </Grid>
                </SubCard>
            </Grid>


        </Grid>
    );
};

export default ClientSelect;
